import { GoogleMap, useJsApiLoader } from '@react-google-maps/api';
import React , {Components} from "react"

function initialize(){

  function success(position) {
    var latitude  = position.coords.latitude;
    var longitude = position.coords.longitude;
    var yourmap = {
        center:new google.maps.LatLng(latitude  ,longitude),
        zoom:11,
        mapTypeId:google.maps.MapTypeId.ROADMAP
    };
    var map=new google.maps.Map(document.getElementById("googleMap"), yourmap);
    var marker=new google.maps.Marker({
    position:new google.maps.LatLng(latitude  ,longitude),
    });

    marker.setMap(map);
    var infowindow = new google.maps.InfoWindow({
      content:"current position"
    });

    infowindow.open(map,marker);
  };

  function error() {
    alert('error');
  };

  var geo_options = {
    enableHighAccuracy: true, 
    maximumAge        : 30000, 
    timeout           : 27000
  };

  if ("geolocation" in navigator) {
    navigator.geolocation.watchPosition(success, error,geo_options );
  }else{
    alert('地理位置不可用');
  }
};
google.maps.event.addDomListener(window, 'load', initialize);





const containerStyle = {
  width: '1400px',
  height: '800px'
};

const center = {
  lat: 25.013625, 
  lng: 121.540470
};

function MyComponent() {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyAj6NGGgE6guMZsGqLod-WTNXcJGwq-DAs"
  })

  const [map, setMap] = React.useState(null)
  const MacAddress = require('get-mac-address');
  const onLoad = React.useCallback(function callback(map) {
    const bounds = new window.google.maps.LatLngBounds(center);
    map.fitBounds(bounds);
    setMap(map)
  }, [])

  const onUnmount = React.useCallback(function callback(map) {
    setMap(null)
  }, [])
  const num = 0;
  return isLoaded ? (
    <body>
      <div id="googleMap" style="width:500px;height:380px;"></div>
      <div><h1>hello</h1><button onClick={(num) => num +1}>{num}</button></div>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={10}
        onLoad={onLoad}
        onUnmount={onUnmount}
      >
        { /* Child components, such as markers, info windows, etc. */ }
        <></>
      </GoogleMap>

      </body>
  ) : <></>

}

export default MyComponent;
